import { useState, useEffect } from "react";
import axios from 'axios';

const TodoList = () => {
const [todos, setTodos] = useState(null);
    useEffect(() => {
        axios.get('http://localhost:3333/api?user_id=1')
        .then((res) => setTodos(res.data))
    });

    return (
        console.log(todos)
    );

};

export default TodoList;
